CREATE VIEW publication_unassigned_v AS
 SELECT publication.uuid,
    publication.date,
    publication.title,
    publication.url
   FROM (publication
     LEFT JOIN prediction_to_publication ON ((publication.uuid = prediction_to_publication.publication_uuid)))
  WHERE (prediction_to_publication.prediction_uuid IS NULL);


